  {
    name: "v-1d5fbf39b34b2",
    path: "/guide.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\importantProgramm\\vuepressBlog\\zhaoshierBlog\\docs\\guide.md").then(comp => {
        Vue.component("v-1d5fbf39b34b2", comp.default)
